OMSystem является разработкой Учреждения «Национальная Академия Наук Высшей Школы Казахстана».
OMSystem - это Казахстанская информационная система мониторинга мнений и упоминаний в информационном пространстве, для использования в корпоративных целях.

OMSystem позволит:
•	Мониторить информационное пространство;
•	Услышать мнение общества;
•	Оценить вовлеченность пользователей в тему.

Среда мониторинга:
•	Ведущие новостные порталы страны и другие интернет-ресурсы;
•	Социальные сети, сайты отзывов.

Результаты:
•	Ежедневный мониторинг информационного пространства и социальных сетей;
•	Анализ упоминаний о бренде, событиях, мероприятиях;
•	Отчеты;
